import React, { useState } from "react";
import { useNavigate } from "react-router-dom";


const Domain = () => {
  const [selectedFile, setSelectedFile] = useState(null);

  const files = [
    
    { name: 'Mandatory Courses', type: 'word', path: 'https://hexawareonline.sharepoint.com/:w:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/01%20ACFC%20Overview/DL%202.0%20Migration%20Project/SOW_AmeriHealth_Datalake%20Migration.docx?d=w6bc6a7001c744156aced23b2b9f4129c&csf=1&web=1&e=H3k8De' },
    { name: 'Medicaid 101', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/01%20ACFC%20Overview/DL%202.0%20Migration%20Project/Hexaware_AmeriHealth_Data%20Lake%20Initiative_v0.2.pptx?d=wc0b0a6c4ff4e4c658c8e6dcb39e631d6&csf=1&web=1&e=c0g33G' },
    { name: 'HIE 101', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/01%20ACFC%20Overview/DL%202.0%20Migration%20Project/Hexaware_AmeriHealth_Data%20Lake%20Initiative_v0.2.pptx?d=wc0b0a6c4ff4e4c658c8e6dcb39e631d6&csf=1&web=1&e=c0g33G' },
    { name: 'C 101', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/01%20ACFC%20Overview/DL%202.0%20Migration%20Project/Hexaware_AmeriHealth_Data%20Lake%20Initiative_v0.2.pptx?d=wc0b0a6c4ff4e4c658c8e6dcb39e631d6&csf=1&web=1&e=c0g33G' },
    { name: 'Hexaware Datalake Initiative PPT', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/01%20ACFC%20Overview/DL%202.0%20Migration%20Project/Hexaware_AmeriHealth_Data%20Lake%20Initiative_v0.2.pptx?d=wc0b0a6c4ff4e4c658c8e6dcb39e631d6&csf=1&web=1&e=c0g33G' },
    { name: 'Hexaware Datalake Initiative PPT', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/01%20ACFC%20Overview/DL%202.0%20Migration%20Project/Hexaware_AmeriHealth_Data%20Lake%20Initiative_v0.2.pptx?d=wc0b0a6c4ff4e4c658c8e6dcb39e631d6&csf=1&web=1&e=c0g33G' }
  ]

  const handleFileDisplay = (path) => {
    // window.open(path, '_blank');
    window.location.href = path;
  };

  return (
    <div className="container">
      <div className="buttons-container">
        {files.map((file, index) => (
          <button key={index} className="button" onClick={() => handleFileDisplay(file.path)}>
            {file.name}
          </button>
        ))}
      </div>
      {selectedFile && (
        <div className="file-container">
          {/* Display the selected file based on its type */}
          {selectedFile.endsWith('.png') && <img className="file-display" src={selectedFile} alt="File" />}
          {selectedFile.endsWith('.pptx') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.pdf') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.docx') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.xlsx') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.video') && (
            <video className="file-display" src={selectedFile} controls>
              Your browser does not support the video tag.
            </video>
          )}
        </div>
      )}
    </div>
  );
};

export default Domain;
